import { useState } from 'react';
import './App.css';
import data from './data';
import Display from './Display';

function App() {

  function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller, item.location, item.rate);

    })
  };


  return (
    <div className="App">
      {
        data.map( ({name, price, pictures, seller, location, rate}) => (
          <div></div>
        ))
      }
    </div>
  );
}

export default App;
